    "## 모폴로지 - 침식과 팽창 \n",
    "\n",
    "- Morphology : 영상의 형태학적 측면을 다루는 기법으로 전처리 등에 사용\n",
    "\n",
    "\n",
    "- Erosion (침식) : 이미지의 경계부분을 배경 픽셀로 변경하는 작업 (1이 0으로 변경)\n",
    "- Dilation (팽창) : 이미지의 배경부분을 전경 픽셀로 변경하는 작업 (0이 1로 변경)\n",
    "  - iterations = 1 : 반복 적용 회수 (회수가 많아지면 침식과 팽창의 효과가 커짐)\n",
    "  \n",
